import style from './Dialogs.module.css';
import DialogItem from "./DialogItem/DialogItem";
import MessageItem from "./MessageItem/MesssageItem";
import {sendMessageActionCreator, updateNewMessageBody} from "../../redux/messages-reducer";
import Dialogs from "./Dialogs";



const DialogsContainer = (props) => {
    let state = props.store.getState();

    let onSendMessageClick = () =>{
        props.dispatch(sendMessageActionCreator());
    }

    let onChangeMessageBody = (text) =>{
        props.dispatch(updateNewMessageBody(text));
    }
    debugger;
    return (
        <Dialogs updateNewMessageBody ={onChangeMessageBody}
                 sendMessage ={onSendMessageClick}
                 newMessageBody = {state.messagesPage.newMessageBody}
                 DialogsProfiles = {state.messagesPage.profiles}
                 DialogsMessages = {state.messagesPage.dialogs}
        />
    );
}

export default DialogsContainer;
